import React from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';
class CustomNavbar extends React.Component{
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    render(){
     return(
         <div>
             <Navbar  light expand="md" className="navbar-background">
                 <NavbarBrand href="/"><i className="fas fa-home fa-2x"></i></NavbarBrand>
                 <div className="input-group mb-3">
                     <input type="text" className="form-control" placeholder="Recipient's username"
                            aria-label="Recipient's username" aria-describedby="basic-addon2"/>
                         <div className="input-group-append">
                             <span className="input-group-text" id="basic-addon2">@example.com</span>
                         </div>
                 </div>
           {/*      <form className="form-inline w-50 mx-auto">
                     <input className=" col-10 rounded-left" type="search" placeholder="Search" aria-label="Search"/>
                     <button className="btn btn-outline-success col-2 rounded-left" type="submit">Search</button>
                 </form>*/}
             </Navbar>

         </div>
     );
    }
}
export default CustomNavbar;
